import jxl.* import jxl.write.* def TestCase = context.testCase def FilePath = "C:\\Users\\PrithaDutta\\Desktop\\soapui\\CustomerData.xls" def count Workbook WorkBook1 = Workbook.getWorkbook(new File(FilePath)) Sheet Sheet1 = WorkBook1.getSheet(0) PropertiesTestStep = TestCase.getTestStepByName("propertiesforcreate") count = PropertiesTestStep.getPropertyValue("counter").toInteger() //If Total records is unknown (at start), get the rowcount from Excel if (PropertiesTestStep.getPropertyValue("total").toString() == "") PropertiesTestStep.setPropertyValue("total", Sheet1.getRows().toString()) count++ //Read the Excel test data Cell Field1 = Sheet1.getCell(0, count) log.info("Count is " + count.toString() + " cust details : " + Field1.getContents())
//Close workbook. WorkBook1.close() //Copy the Excel test data to properties in Properties test step
